import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles/Feedback.css'; // קובץ CSS לעיצוב

const Feedback = () => {
  const [feedbacks, setFeedbacks] = useState([]);

  useEffect(() => {
    // קריאה לשרת לקבלת הפידבקים
    const fetchFeedbacks = async () => {
      try {
        const response = await axios.get('http://localhost:5001/api/feedback');
        setFeedbacks(response.data);
      } catch (error) {
        console.error('Error fetching feedback:', error);
      }
    };

    fetchFeedbacks();
  }, []);

  return (
    <>
      {/* Header */}
      <header data-bs-theme="dark">
        <nav className="navbar navbar-expand-md navbar-dark fixed-top bg-dark">
          <div className="container-fluid">
            <div className="navbar-brand">
              <img
                src={require('../images/logo.png')}
                alt="DeepFakeAudio Logo"
                className="logo"
              />
              DeepFakeAudio
            </div>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarCollapse"
              aria-controls="navbarCollapse"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarCollapse">
              <ul className="navbar-nav me-auto mb-2 mb-md-0">
                <li className="nav-item">
                  <a className="nav-link active" aria-current="page" href="/">
                    Logout
                  </a>
                </li>
              </ul>
              <form className="d-flex" role="search">
                <input
                  className="form-control me-2"
                  type="search"
                  placeholder="Search"
                  aria-label="Search"
                />
                <button className="btn btn-outline-success" type="submit">
                  Search
                </button>
              </form>
            </div>
          </div>
        </nav>
      </header>

      {/* Feedback Table */}
      <div className="feedback-container">
        <h1>User Feedback</h1>
        {feedbacks.length === 0 ? (
          <p>No feedback available.</p>
        ) : (
          <table className="feedback-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>User</th>
                <th>Usability</th>
                <th>Design</th>
                <th>Performance</th>
                <th>Message</th>
              </tr>
            </thead>
            <tbody>
              {feedbacks.map((feedback) => (
                <tr key={feedback.id}>
                  <td>{feedback.id}</td>
                  <td>{feedback.username || 'Anonymous'}</td>
                  <td>{feedback.usability_rating || 'N/A'}</td>
                  <td>{feedback.design_rating || 'N/A'}</td>
                  <td>{feedback.performance_rating || 'N/A'}</td>
                  <td>{feedback.message}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </>
  );
};

export default Feedback;
